  \"2013-03-16T00:53:52.043101\",\n\t\"name\": \"hydrologic-reconnaissance-of-the-promontory-mountains-area-box-elder-county-utah\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Promontory Mountains area is in eastern
  Box Elder County, and its drainage is directly tributary to Great Salt Lake. The
  drainage area consists of 228,000 acres extending from T. 6 N. to T. 11 N. and from
  R. 5 W. to R. 8 W. Ground water is most uniformly available from unconsolidated
  and semiconsolidated rocks of Cenozoic (Tertiary and Quaternary) age, but substantial
  quantities of water also are obtained, mainly through springs, from consolidated
  rocks of Precambrian and Palezoic age.nnnPart of the water in the Promontory Mountains
  area is derived from precipitation, which is estimated to average 240,000 acre-feet
  annually. Of this amount, about 93 percent is consumed at or near the point of fall.
  An estimated 4,000 acre-feet runs off in streams. The total runoff is estimated
  to average 6,000 acre-feet and includes unconsumed spring discharge.\",\n\t\"license_title\":
